description:
La loi du 13 août 2004 relative à l’assurance maladie charge la HAS d’établir une procédure de certification des Logiciels d’Aide à la Prescription (LAP). Les éditeurs de LAP peuvent se faire certifier par des organismes certificateurs, eux-mêmes accrédités par le Comité français d’accréditation (Cofrac).
La loi du 29 décembre 2011 relative au renforcement de la sécurité sanitaire du médicament et des produits de santé rend obligatoire la certification des LAP.
Le champ d’application du référentiel de juin 2012 concerne les LAP destinés aux établissements de santé. Il a pour objectif de promouvoir des fonctionnalités susceptibles :
- d’améliorer la qualité de la prescription ;
- de faciliter le travail du prescripteur et de favoriser la conformité réglementaire des prescriptions ;
- de diminuer le coût du traitement à qualité égale.

Ce jeu de données est une extraction du système national des données de santé (SNDS) portant sur l'ensemble des remboursements mensuels effectués par le régime général de l'Assurance Maladie (hors prestations hospitalières) par type de prestations (soins et prestations en espèces), type d'exécutant (médecins par spécialité, chirurgiens dentistes, auxiliaires médicaux, laboratoires d'analyse, pharmaciens, ...) et par type de prescripteurs. Les dépenses sont indiquées en montants remboursés et présentées au remboursement.
### **Descriptions des données**
Le jeu de données contient l'ensemble des remboursements nationaux mensuels de soins de ville effectués par le régime général de l'Assurance Maladie par :
* type de poste de dépenses ;
* type de prestation (soins et prestations en espèces) ;
* type d'exécutant (médecins par spécialité, chirurgiens-dentistes, auxiliaires médicaux, laboratoires d'analyses, pharmaciens, etc.) ;
* type de prescripteur ;
* date de soins ;
* taux de remboursement ;
* type de risque couvert (maladie, maternité, accident du travail et maladie professionnelle).
Les indicateurs de dépenses sont :
* la base de remboursement de l’Assurance Maladie ;
* le montant remboursé ;
* les dépassements d’honoraires des professionnels de santé ;
* le dénombrement des actes réalisés et des coefficients facturés.
Des éléments complémentaires sont disponibles dans le document Descriptif.xls
<br />
Concernant les dépenses de santé d'assurance maladie, d'autres jeux de données, couvrant des champs différents, sont proposés :
* [Open Damir : base complète sur les dépenses d'assurance maladie interrégimes](https://www.data.gouv.fr/datasets/open-damir-base-complete-sur-les-depenses-dassurance-maladie-interregimes/) : base de données regroupant l'ensemble des remboursements (y compris prestations hospitalières facturées directement à l'Assurance Maladie) effectués par tous les régimes d'assurance maladie en France.
* [Données nationales sur les dépenses d'assurance maladie relatives aux établissements de santé privés](https://www.data.gouv.fr/datasets/donnees-nationales-sur-les-depenses-dassurance-maladie-relatives-aux-etablissements-de-sante-prives/) : base de données des remboursements de soins effectués par le régime général de l'Assurance Maladie, relatifs aux établissements de santé privés, au niveau national.
* [Données par CPAM sur les dépenses d'assurance maladie relatives aux établissements de santé privés](https://www.data.gouv.fr/datasets/donnees-par-cpam-sur-les-depenses-dassurance-maladie-relatives-aux-etablissements-de-sante-prives/) : base de données des remboursements de soins effectués par le régime général de l'Assurance Maladie, relatifs aux établissements de santé privés, au niveau national, par caisse primaire d'assurance maladie (CPAM).
